INSERT INTO `sys_notice` VALUES ('1', '温馨提醒：今日气温过高请做好防晒', '2', '由于天气影响，重庆近一周的天气持续高温状态，最高温度达到35度，请各位居民朋友出门做好相应防晒。', '0', 'admin', '2020-04-16 11:33:00', 'admin', '2020-05-19 11:50:16', '管理员', '1');
INSERT INTO `sys_notice` VALUES ('2', '维护通知：20204.20-4.21号系统维护通知', '1', '由于系统更新，占用4月20号晚上8点以后到四月21号早上八点以前进行系统维护，在此期间各位用户不能使用系统，为此造成的不便，还请见谅。', '0', 'admin', '2020-04-20 11:33:00', 'admin', '2020-05-06 10:54:44', '管理员', '1');
INSERT INTO `sys_notice` VALUES ('3', '召开社区选举大会', '2', '社区即将召开社区公共选举大会，桶工居民的不记名投票方式选举出社区街道办事处的代表，希望小区类的居民每家抽出一个代表来参加明天下午两点的选举大会', '0', 'admin', '2020-05-16 23:09:08', 'admin', '2020-05-16 23:36:32', null, '0');
INSERT INTO `sys_notice` VALUES ('4', '疫情大会', '2', '由于疫情期间有很多的注意事项，经过社区讨论决定组织一次社区疫情大会，分批次召开，避免人流过大。请每户居民在明天上午10点到街道办事处参加，后期通知名单。', '0', 'admin', '2020-05-19 11:09:23', 'admin', '2020-05-19 13:26:34', null, '1');
INSERT INTO `sys_notice` VALUES ('5', '系统修复', '1', '系统的用户管理模块功能修复，预期时间是今天晚上8点到明天早上8点', '0', 'admin', '2020-05-19 11:10:55', 'admin', '2020-05-19 13:27:33', null, '0');
INSERT INTO `sys_notice` VALUES ('6', '防火防盗', '1', '近日接到很多的居民举报，有不法分子在我社区内活动，提醒大家主要人身财产安全。', '0', 'admin', '2020-05-19 11:38:56', 'admin', '2020-05-19 11:51:07', null, '0');
